"108977":{"id":"108977","name":"Project Scard: Praeter no Kizu","slug":"project-scard-praeter-no-kizu","original_title":"プレイタの傷","overview":"A história se passa em uma região fictícia de Tóquio conhecido como Akatsuki. Após uma rebelião para tomar o poder dos líderes corporativos do local, Akatsuki se tornou uma região sem leis, sendo controlada por três grandes organizações: Helios, Artemis e a Secretária de Segurança Pública. Cada uma das organizações controla um grupo de Scards, agentes especiais que receberam uma tatuagem divina que evita que eles sejam atingidos por qualquer lâmina ou bala, os tornando invencíveis.","first_air_date":"2021-01-09","episode_run_time":24,"vote_average":3.2,"number_of_seasons":1,"number_of_episodes":13,"created_by":[],"production_companies":["GoHands"],"genres":["Animação","Action & Adventure"],"certification":"N/A","backdrop_path":"https://image.tmdb.org/t/p/original/xjlfkkARk6ApJwLWNFQ8Sf5O4e0.jpg","poster_path":"https://image.tmdb.org/t/p/original/qyMM0PVhHNocADOGex4j2uyBQpL.jpg","cast":["ランズベリー・アーサー","髙坂篤志","Shoya Chiba","Junya Enoki","益山武明"],"trailer":"N/A","seasons":{"1":{"name":"Temporada 1","poster_path":"https://image.tmdb.org/t/p/original/qyMM0PVhHNocADOGex4j2uyBQpL.jpg","backdrop_path":"https://image.tmdb.org/t/p/original/qyMM0PVhHNocADOGex4j2uyBQpL.jpg","air_date":"2021-01-09","episode_count":13,"overview":"N/A","vote_average":0,"episodes":{"1":{"name":"A Cidade Tinha Seu Herói","overview":"Na Ala Especial da Akatsuki, os infelizes se voltam para os Scard e suas poderosas tatuagens para obter proteção. Um dia, um jovem chamado Yamato conhece o herói da cidade, um Scard chamado Eiji, e eles são levados para uma batalha com a organização criminosa Dusk.","air_date":"2021-01-09","runtime":24,"still_path":"https://image.tmdb.org/t/p/original/bSc0DlL7f1jUhVXD6hye2iLpNvt.jpg","vote_average":0},"2":{"name":"Cerberus","overview":"Após a luta com Dusk, Yamato acorda no hospital. O detetive Kouga diz a Yamato que Eiji está morto e o pressiona para se juntar ao PSSS. Enquanto Dusk organiza um ataque para libertar seu povo do hospital, Yamato é forçado a fazer uma escolha...","air_date":"2021-01-16","runtime":24,"still_path":"https://image.tmdb.org/t/p/original/2b8pbjBIvqHYrcwGNnvvtEq84XG.jpg","vote_average":0},"3":{"name":"As Asas Gêmeas de Artemis","overview":"Yamato conta a Helios tudo sobre a morte de Eiji, mas é suspeito de estar conectado com o misterioso Fenrir. Enquanto isso, uma garota que está sendo perseguida por Artemis pede ajuda a Helios. Yamato e Kazuma vão escoltá-la, mas são apanhados de surpresa por Ran e Jin...","air_date":"2021-01-23","runtime":24,"still_path":"https://image.tmdb.org/t/p/original/2qHWi1H7UTq0e5niXGCszLzWiaF.jpg","vote_average":0},"4":{"name":"Serviço Especial de Segurança Pública","overview":"Enquanto procuram Fenrir, Kazuma e Yamato ouvem uma explosão e encontram várias marcas grandes de garras. Mais tarde, o PSSS aparece no Titã. Yamato foge e Itsuki vai atrás dele. Kazuma enfrenta Kouga, mas é impedido pela tatuagem de Kouga, Fafnir...","air_date":"2021-01-30","runtime":24,"still_path":"https://image.tmdb.org/t/p/original/pPzODsjCAHUaAt3vqs7u0mGrkyb.jpg","vote_average":0},"5":{"name":"Nós, as Asas Gêmeas, Juramos Solenemente","overview":"Ran e Jin estão perseguindo um colaborador do Dusk dentro de Artemis, assim como Fenrir, que tem atacado os membros de Artemis. Eles vão primeiro ao Titã para obter informações sobre Fenrir, em seguida, fazem uma visita ao predecessor de Ran, esperando por algum tipo de descoberta. O que eles encontram é...","air_date":"2021-02-06","runtime":24,"still_path":"https://image.tmdb.org/t/p/original/tLRsIO7wBAgyn12YMgQzNFyqEFo.jpg","vote_average":0},"6":{"name":"Justiça Com Força","overview":"Tendo perguntas sobre o comportamento de Yamato após seu recente confronto, Itsuki visita o irmão de Yamato, Minato, em busca de respostas. Enquanto isso, Kazuma pega um resfriado após dias perseguindo Fenrir. É quando Yamato se oferece para lhe dar uma remédio caseiro que contém bebida alcóolica...","air_date":"2021-02-13","runtime":24,"still_path":"https://image.tmdb.org/t/p/original/kQzDImbcsbL5sYHCQzdmrAg49sT.jpg","vote_average":0},"7":{"name":"Dusk Chega","overview":"Irritado porque Yamato lutou com Fenrir primeiro, Kazuma desafia Yamato para uma luta e perde. Enquanto Kazuma reflete sobre o quanto se sente impotente, de repente ele vê Fenrir parado diante dele. Mal sabe ele que Dusk também está se preparando para fazer seu ataque...","air_date":"2021-02-20","runtime":24,"still_path":"https://image.tmdb.org/t/p/original/p5ZLjlifGFYMIIvDCeC89VrjO50.jpg","vote_average":0},"8":{"name":"Alvorecer","overview":"Com Kazuma fora de combate, Yamato segue para B1 para enfrentar Dusk sozinho. No entanto, ele está sobrecarregado pelo grande número de soldados de infantaria que se opõem a ele. É quando um carro familiar estaciona e uma figura aparece em um telhado sob a lua cheia...","air_date":"2021-02-27","runtime":24,"still_path":"https://image.tmdb.org/t/p/original/oamSCPT1twcOzyHeRTMPSpxKPL5.jpg","vote_average":0},"9":{"name":"As Marcas de Garras do Warg","overview":"No dia seguinte à derrota do Dusk, Helios investiga a possível conexão entre Dusk e Fenrir. Enquanto isso, Ran e Jin descobrem que Fenrir atacou a Artemis Finance. Eles correm para o escritório de Azusa e a encontram no chão, imóvel...","air_date":"2021-03-06","runtime":24,"still_path":"https://image.tmdb.org/t/p/original/9ZBJ4cc0g51gscT9Wmu8dwm4ed0.jpg","vote_average":0},"10":{"name":"A Lua e o Sol","overview":"Enquanto Artemis se prepara para lutar contra Helios, Ran e Jin acreditam que podem acabar com Fenrir após derrotar Yamato e Kazuma. Enquanto isso, enfrentando seus ferimentos críticos, Azusa e Kagami se unem em uma corrida contra o tempo para parar tudo...","air_date":"2021-03-13","runtime":24,"still_path":"https://image.tmdb.org/t/p/original/71gp3jruBDp6vMQ7SfbKEDWFjPx.jpg","vote_average":0},"11":{"name":"Fenrir","overview":"Kazuma era Fenrir o tempo todo. A tatuagem o possuiu há três anos, e selá-la com Cat-sìth era a única maneira de mantê-la sob controle. Mas o choque da morte de Eiji enfraqueceu o selo. E agora que ele está quebrado, Fenrir revela outra verdade chocante...","air_date":"2021-03-20","runtime":24,"still_path":"https://image.tmdb.org/t/p/original/1HbwNlqVTRW5dq2QDaIv2quaGdj.jpg","vote_average":0},"12":{"name":"O Bloqueio de Akatsuki","overview":"Sob o comando de Kouga, a Equipe SWAT se move para bloquear totalmente a Ala Especial de Akatsuki. Kagami revela que tudo começou a partir de uma proposta de Kouga. E Kazuma/Fenrir tem planos de se destruir depois de eliminar tudo e todos ao seu redor...","air_date":"2021-03-27","runtime":24,"still_path":"https://image.tmdb.org/t/p/original/aSeR2x4UVUafB0XnSRb3R4onNu.jpg","vote_average":0},"13":{"name":"Herói de Akatsuki","overview":"Tendo derrotado Yamato, Fenrir ataca a equipe da SWAT. Artemis e PSSS decretam uma trégua para que Artemis possa ir atrás de Fenrir e o PSSS possa ajudar a equipe SWAT. Enquanto isso, Eiji confronta Fenrir para fazê-lo desistir do controle do corpo de Kazuma...","air_date":"2021-04-03","runtime":24,"still_path":"https://image.tmdb.org/t/p/original/lcyGvtudaj0X0X9HnHsilUmYpYs.jpg","vote_average":0}}}}},
