"224753":{"id":"224753","name":"Pseudo Harem","slug":"pseudo-harem","original_title":"疑似ハーレム","overview":"Eiji Kitahama entra para o clube de teatro com sonho de ser dono de um harém, como aqueles do seu mangá favorito. Rin Nanakura, uma estudante mais nova, fica perdidamente apaixonada por Eiji e experimenta diferentes personalidades na presença dele para tentar conquistá-lo. Não importa como ela age, uma coisa é certa: seus sentimentos por Eiji continuam a crescer cada vez mais. Será que ela vai conseguir contar a verdade para ele e mostrar quem ela é de verdade?","first_air_date":"2024-07-05","episode_run_time":24,"vote_average":8,"number_of_seasons":1,"number_of_episodes":12,"created_by":[],"production_companies":["Nomad","Pony Canyon","bilibili","Tokyo MX","BS Fuji"],"genres":["Animação","Comédia"],"certification":"14","backdrop_path":"https://image.tmdb.org/t/p/original/7lOCYnmGNAusEiBKZCBmPrdVEX8.jpg","poster_path":"https://image.tmdb.org/t/p/original/4n8PhldOBDNJWoHN55tfQ3Ird5J.jpg","cast":["Nobuhiko Okamoto","Saori Hayami","鳴海まい","Junichi Suwabe","Koji Yusa"],"trailer":"N/A","seasons":{"1":{"name":"Temporada 1","poster_path":"https://image.tmdb.org/t/p/original/4n8PhldOBDNJWoHN55tfQ3Ird5J.jpg","backdrop_path":"https://image.tmdb.org/t/p/original/4n8PhldOBDNJWoHN55tfQ3Ird5J.jpg","air_date":"2024-07-05","episode_count":12,"overview":"N/A","vote_average":6.7,"episodes":{"1":{"name":"O Começo de uma História?","overview":"Rin Nanakura começa a estudar no Colégio Kouban, quando recebe o convite de Eiji para o Clube de Teatro. Ela, no entanto, se apaixona e precisa fazer que ele acredite que seu amor não é tão grande assim.","air_date":"2024-07-05","runtime":24,"still_path":"https://image.tmdb.org/t/p/original/t3di68dJWBfYxzyOpmZmoOIb8iO.jpg","vote_average":7.3},"2":{"name":"Confissão de amor?","overview":"Rin quer se aproximar mais de Eiji, no entanto, não sabe o que fazer para isso. Talvez com a chegada do frio ela tenha alguma chance...","air_date":"2024-07-12","runtime":24,"still_path":"https://image.tmdb.org/t/p/original/l2stYVorE677K0LICnCGKbyvBJ0.jpg","vote_average":6.3},"3":{"name":"Aulas de Amor?","overview":"Eiji quer aprender mais sobre romance, e Rin é a especialista que está disposta a ensinar. Mal sabe ele que o amor pode estar bem ao seu lado...","air_date":"2024-07-19","runtime":24,"still_path":"https://image.tmdb.org/t/p/original/rXtMDjsawFIS5nDsa6fGNGC8Wkl.jpg","vote_average":6.7},"4":{"name":"WOW?","overview":"Rin quer que Eiji se aproxime ainda mais dela e passe a chamá-la pelo nome. No entanto ele esquiva de todas as chances que ela tem. Até que um dia, voltando para casa, os dois são surpreendidos pela chuva...","air_date":"2024-07-26","runtime":24,"still_path":"https://image.tmdb.org/t/p/original/asMcD73pnkIZltwuRpe7xnL37KB.jpg","vote_average":6},"5":{"name":"Férias de Verão","overview":"Chegam as férias de verão, e Rin quer fazer o possível para ficar o máximo de tempo com o Eiji. Mas será que ela vai conseguir?","air_date":"2024-08-02","runtime":24,"still_path":"https://image.tmdb.org/t/p/original/cCOcsTeTSPIV7TYL9iSJgTFToEp.jpg","vote_average":6},"6":{"name":"Primeiro Encontro?","overview":"O clube de teatro se prepara para uma grande apresentação, mas Rin só quer ficar perto de Eiji. Mas será que o relacionamento dos dois vai conseguir sair do lugar?","air_date":"2024-08-09","runtime":24,"still_path":"https://image.tmdb.org/t/p/original/tVEPnHLu7wm3W57AgZbi5s7n2pQ.jpg","vote_average":6.5},"7":{"name":"Formatura","overview":"Se aproxima a formatura de Eiji. Rin não sabe o que fazer, já que seus momentos com ele vão diminuir cada vez mais. Mas antes disso ele vai ter a oportunidade de atuar com ela em uma última peça! Rin cada vez mais sente vontade de revelar seus sentimentos para ele, mas será que ela vai conseguir?","air_date":"2024-08-16","runtime":24,"still_path":"https://image.tmdb.org/t/p/original/lnSfnLOlxqojnQBtGdkKL1NqKkB.jpg","vote_average":7},"8":{"name":"Adultos","overview":"Eiji saiu do colégio e agora ele convive cada vez menos com Rin. No entanto, eles estão determinados a se manterem próximos. E agora Eiji precisa de uma ajuda para saber o que vestir quando entrar na Faculdade.","air_date":"2024-08-23","runtime":24,"still_path":"https://image.tmdb.org/t/p/original/4m6A2dDn6JDnac85yEi9vlFjYfU.jpg","vote_average":7},"9":{"name":"Pessoa para Amar","overview":"Rin está preocupada com a popularidade de Eiji na faculdade e abre seu coração pare ele. Eiji chama ela para passar um dia com ele na faculdade. Mas será que Rin está certa de estar preocupada?","air_date":"2024-08-30","runtime":24,"still_path":"https://image.tmdb.org/t/p/original/vnTi6bcepfiYHiFsD0IZtYfwKVs.jpg","vote_average":6},"10":{"name":"Aniversário","overview":"O aniversário de Rin se aproxima e Eiji começa a dar seus pulos em busca do melhor presente. Resta saber se ele conseguirá agradar todas as versões da Rin.","air_date":"2024-09-06","runtime":24,"still_path":"https://image.tmdb.org/t/p/original/7PNioirWAPIVbwaUASkAJgzFbDT.jpg","vote_average":7},"11":{"name":"Triângulo Amoroso?","overview":"Eiji tira a carteira de motorista e sai para levar Rin. No entanto, as outras personalidades dela parecem um tanto chateadas com a última confissão de amor dele...","air_date":"2024-09-13","runtime":24,"still_path":"https://image.tmdb.org/t/p/original/i6CxwtfDwOp6DvPuhhv2lEXmR7f.jpg","vote_average":7},"12":{"name":"O começo de uma história","overview":"Rin e Eiji tem oportunidade de trabalharem juntos em um curta. No entanto, isso acaba colocando Rin contra a parede para tomar uma decisão difícil...","air_date":"2024-09-20","runtime":24,"still_path":"https://image.tmdb.org/t/p/original/njUTwf9uBLRzvVIKqrSukjPlXj0.jpg","vote_average":8}}}}},
