"240682":{"id":"240682","name":"Astro Note","slug":"astro-note","original_title":"アストロノオト","overview":"Takumi, um chef talentoso, acabou de ser demitido de seu emprego. Ele consegue um trabalho em uma antiga pensão chamada “Astro-sou”, mas fica um pouco hesitante em aceitar ao descobrir que também precisará morar lá em tempo integral. Isso até ele conhecer a bela e encantadora zeladora, Mira, que faz com que Takumi mude de ideia bem rápido. Os dois começam a trabalhar juntos, e a conexão entre eles se aprofunda. No entanto, Mira guarda um segredo profundo: ela não é deste mundo!","first_air_date":"2024-04-05","episode_run_time":24,"vote_average":6.1,"number_of_seasons":1,"number_of_episodes":12,"created_by":[],"production_companies":["Telecom Animation Film","Shochiku","Crunchyroll","Tokyu Agency","Tokyo MX","Bandai Namco Music Live","BS Asahi","movic","Crunchyroll"],"genres":["Animação","Comédia","Sci-Fi & Fantasy"],"certification":"14","backdrop_path":"https://image.tmdb.org/t/p/original/bM0Jtv4VjvUx0FfW0uc34rD0IGo.jpg","poster_path":"https://image.tmdb.org/t/p/original/t80gwqjaQ5QtYP5NDFHtFnpgnqL.jpg","cast":["Maaya Uchida","Soma Saito","Rie Kugimiya","Tomokazu Sugita","Shin'ichirō Miki"],"trailer":"GABZlDpPlaw","seasons":{"1":{"name":"Temporada 1","poster_path":"https://image.tmdb.org/t/p/original/t80gwqjaQ5QtYP5NDFHtFnpgnqL.jpg","backdrop_path":"https://image.tmdb.org/t/p/original/t80gwqjaQ5QtYP5NDFHtFnpgnqL.jpg","air_date":"2024-04-05","episode_count":12,"overview":"N/A","vote_average":6.7,"episodes":{"1":{"name":"Astro Note","overview":"Takumi chega na Pensão Astro à procura de um emprego, mas parece que o panfleto de recrutamento estava um pouco diferente da realidade. Mesmo assim, ele decide ficar depois de se apaixonar por Mira.","air_date":"2024-04-05","runtime":24,"still_path":"https://image.tmdb.org/t/p/original/fn35XRcqL07iMasT8JIVttoO1gi.jpg","vote_average":5},"2":{"name":"Astro Note #2","overview":"Takumi segue procurando emprego e decide até rezar em um templo para tentar melhorar a própria sorte. Enquanto isso, Mira e Naosuke continuam sua missão, e ela descobre que o ex-proprietário pode ter alguma relação com a chave.","air_date":"2024-04-12","runtime":24,"still_path":"https://image.tmdb.org/t/p/original/n6J2OSUQkknmnd3ayxeqU9sgKoj.jpg","vote_average":6.5},"3":{"name":"Astro Note #3","overview":"Shoin é o amigo de infância da Mira que decide vir à Terra para ajudá-la a procurar a chave. No entanto, os outros moradores da pensão começam a desconfiar que os dois sejam apenas amigos de infância depois da brincadeira sobre ele ser \"noivo\". E, para a tristeza de Takumi, Shoin é bonito, rico e galanteador!","air_date":"2024-04-19","runtime":24,"still_path":"https://image.tmdb.org/t/p/original/yXI91VIhOBK54wgwCXLv0crgeGw.jpg","vote_average":7},"4":{"name":"Astro Note #4","overview":"Mira pede a ajuda de Takumi para lidar com o misterioso ladrão de cafés da manhã. Ele bola um plano que acredita ser infalível, mas...","air_date":"2024-04-26","runtime":24,"still_path":"https://image.tmdb.org/t/p/original/gLSnEHYRJWVeGVLIlCgTxRjc5NN.jpg","vote_average":6},"5":{"name":"Astro Note #5","overview":"Takumi ainda está em choque com as \"descobertas\" sobre a Mira, e isso começa a ter consequências no café da manhã da Pensão Astro.","air_date":"2024-05-03","runtime":24,"still_path":"https://image.tmdb.org/t/p/original/fDggzWejUukYdBmxSD7Snw2q9pV.jpg","vote_average":6.5},"6":{"name":"Astro Note #6","overview":"A mãe de Mira mandou uma mensagem em forma de vídeo sobre seu passado. Takumi acaba ouvindo a mensagem e descobrindo a identidade de Mira, Naosuke e Shoin!","air_date":"2024-05-10","runtime":24,"still_path":"https://image.tmdb.org/t/p/original/8RYA025JWM9FARgMyUIEIoyv8pF.jpg","vote_average":7},"7":{"name":"Astro Note #7","overview":"Aoi e Takumi vão para o Festival de Insetos. Não parece o melhor lugar para um encontro, mas será que havia um plano por trás desse convite inusitado?","air_date":"2024-05-17","runtime":24,"still_path":"https://image.tmdb.org/t/p/original/iUxqwqDUR0XFFyGjCXOM0nc8qf5.jpg","vote_average":6.5},"8":{"name":"Astro Note #8","overview":"Takumi, aceitando melhor a verdade por trás de Mira, está contribuindo cada vez mais com a missão dela e de Naosuke. Contudo, Naosuke ainda está precisando aceitar o Takumi e a relação dele com Aoi.","air_date":"2024-05-24","runtime":24,"still_path":"https://image.tmdb.org/t/p/original/sE0yaLzQxDgZ60wpGbyWsFKetGP.jpg","vote_average":7},"9":{"name":"Astro Note #9","overview":"Takumi não consegue se esquecer do ocorrido com a Aoi do dia anterior e finalmente percebe que ela está apaixonada por ele. Agora, resta ver como ele lidará com isso.","air_date":"2024-05-31","runtime":24,"still_path":"https://image.tmdb.org/t/p/original/pKE8JKCBT9glNTOE1ZlNgGCT22q.jpg","vote_average":7},"10":{"name":"Astro Note #10","overview":"Os moradores da Pensão Astro recebem mais um novo membro: Ginger Shoin. Pouco tempo depois, Matsubara é atacada por um broto de bambu.","air_date":"2024-06-07","runtime":24,"still_path":"https://image.tmdb.org/t/p/original/mcqbR1K5g0EXSTYa44Wxwj1xWQ6.jpg","vote_average":7},"11":{"name":"Astro Note #11","overview":"Depois de compararem a pensão com as fotos do passado, Mira e seus amigos finalmente conseguem encontrar a tão querida chave! Entretanto, isso também significa que ela se despedirá dos moradores...","air_date":"2024-06-14","runtime":24,"still_path":"https://image.tmdb.org/t/p/original/xbv4GOB1dVmhSL9igh6RvRujZwW.jpg","vote_average":7.5},"12":{"name":"Astro Note #12","overview":"A Pensão Astro era, na verdade, um robô! Agora, este robô será usado por Mira e Miyasaka para proteger a Terra dos terríveis Maridos e seu Imperador.","air_date":"2024-06-21","runtime":24,"still_path":"https://image.tmdb.org/t/p/original/beoyw9JOheL9CCQ32Y78qjCnWJ7.jpg","vote_average":7.5}}}}},
