"255492":{"id":"255492","name":"Sakuna: Of Rice and Ruin","slug":"sakuna-of-rice-and-ruin","original_title":"天穂のサクナヒメ","overview":"Na antiga terra de Yanato existem dois reinos: o Reino Superior, onde residem os deuses, e o Reino Inferior, onde residem os humanos. A princesa Sakuna era filha do deus da guerra e da deusa da colheita, mas levava uma vida preguiçosa. Um dia, ela é banida para a Ilha Hinoe, a Ilha dos Demônios. Presa em uma terra árida, Sakuna sai para matar demônios e cultivar arroz. Sua nova aventura começa!","first_air_date":"2024-07-06","episode_run_time":24,"vote_average":7.8,"number_of_seasons":1,"number_of_episodes":13,"created_by":[],"production_companies":["P.A.WORKS","TOHO","TV Tokyo","QROUT"],"genres":["Animação","Action & Adventure","Sci-Fi & Fantasy"],"certification":"12","backdrop_path":"https://image.tmdb.org/t/p/original/xu2nKEcu3NpvLAvhoBbxQDv3icG.jpg","poster_path":"https://image.tmdb.org/t/p/original/a36F4UyUhYEj8rm3AKBXPmy1SFc.jpg","cast":["Naomi Ozora","鳴海崇志","衣川里佳","矢野龍太","久保田ひかり"],"trailer":"N/A","seasons":{"1":{"name":"Temporada 1","poster_path":"https://image.tmdb.org/t/p/original/a36F4UyUhYEj8rm3AKBXPmy1SFc.jpg","backdrop_path":"https://image.tmdb.org/t/p/original/a36F4UyUhYEj8rm3AKBXPmy1SFc.jpg","air_date":"2024-07-06","episode_count":13,"overview":"N/A","vote_average":6.4,"episodes":{"1":{"name":"O Mundo do Cume e a Princesa Sakuna","overview":"Sakuna é a deusa da colheita e tem curtido a vida sem muita preocupação com o estoque de arroz deixado por seus pais. No entanto, um evento faz com que ela seja obrigada a deixar sua vida agradável e partir em direção a novos desafios.","air_date":"2024-07-06","runtime":24,"still_path":"https://image.tmdb.org/t/p/original/sSrh6a8CahcX8ygAW69MyYuUpqp.jpg","vote_average":6.5},"2":{"name":"Vamos morar na Ilha Hinoe","overview":"Sakuna chega até a Ilha Hinoe com seus novos companheiros. Em meio a todos os problemas, eles precisam descobrir as habilidades de cada um para continuarem a sobreviver na ilha.","air_date":"2024-07-13","runtime":24,"still_path":"https://image.tmdb.org/t/p/original/gP6Hriq2VK3K11aqC2auSdwhobH.jpg","vote_average":7},"3":{"name":"Canção de Plantar Arroz","overview":"Sakuna finalmente consegue plantar arroz. No entanto, o conflito com os outros moradores começa a fazer ela repensar todo o trabalho que está levando. E agora, será que ela vai continuar se esforçando ou vai abandonar tudo e todos e voltar para a capital?","air_date":"2024-07-20","runtime":24,"still_path":"https://image.tmdb.org/t/p/original/oaSGKaLTGBoP3Q4vtYC24Ot1EHf.jpg","vote_average":6},"4":{"name":"Myrthe's Journey","overview":"Myrthe conta um pouco de sua jornada até agora e das suas crenças. Todos resolvem ir até um rio próximo em busca de ajuda dos kappa, mas de repente eles atacam Myrthe. Em meio a tudo, será que sociedades de locais diferentes podem aceitar pessoas de outros lugares?","air_date":"2024-07-27","runtime":24,"still_path":"https://image.tmdb.org/t/p/original/bDPtrNHz2AmYhdKuzDr8s6S4TSm.jpg","vote_average":6},"5":{"name":"Kinta paga sua dívida","overview":"A forja fica pronta e Kinta vai para lá. Yui quer recompensá-lo de alguma forma, então pede a Sakuna para construir uma casa de tecelagem.","air_date":"2024-08-03","runtime":24,"still_path":"https://image.tmdb.org/t/p/original/yiyWif1wf9oeMMCNXuddfBIODQ4.jpg","vote_average":0},"6":{"name":"Chamas do Ódio","overview":"Ao mesmo tempo que a colheita se aproxima, peixes mortos no rio indicam algo de errado no vulcão. Sakuna vai investigar junto com Ashigumo.","air_date":"2024-08-10","runtime":24,"still_path":"https://image.tmdb.org/t/p/original/ksgDmQlE5BulGUrKjFZLS0IpUAm.jpg","vote_average":0},"7":{"name":"A Melancolia da Princesa Kokorowa","overview":"Sakuna volta para a capital para se encontrar com a Deusa Kamuhitsuki, enquanto sua amiga Kokorowa está estranhamente distante.","air_date":"2024-08-17","runtime":24,"still_path":"https://image.tmdb.org/t/p/original/lusWDFSz4auBLoxaeiruH868bFo.jpg","vote_average":0},"8":{"name":"A Revolta do Arroz que Abalou a Capital","overview":"Sakuna descobre que há algo errado com o Amahoho na capital. Parece que há alguém misturando o arroz com algo que pode deixar as pessoas viciadas.","air_date":"2024-08-24","runtime":24,"still_path":"https://image.tmdb.org/t/p/original/xCiKULZcanR4Gv7u47X8j8EjLTl.jpg","vote_average":0},"9":{"name":"Aquele que controla os demônios","overview":"Um demônio ferido aparece na passagem das montanhas e Sakuna e seus amigos não sabem ao certo o que fazer. Buscando a origem do demônio, Sakuna descobre um local incomum, onde podem estar as pistas necessárias para elucidar o mistério da ilha.","air_date":"2024-08-31","runtime":24,"still_path":"https://image.tmdb.org/t/p/original/6SiDjJTEdyym2EabWjYJ3XZfWvu.jpg","vote_average":0},"10":{"name":"Recuperação","overview":"Sakuna se depara com toda a sua plantação destruída e seus amigos desaparecidos. Ela sabe que não tem tempo a perder, mas sua amiga parece ter uma solução.","air_date":"2024-09-07","runtime":24,"still_path":"https://image.tmdb.org/t/p/original/7eMUIUGjpZcFm9cWal8O9uag8Qz.jpg","vote_average":0},"11":{"name":"Luz do Perdão","overview":"Tauemon entra em conflito com Ishimaru, mas algo misterioso acontece com Kaimaru. Após isso, fenômenos estranhos começam a acontecer na ilha.","air_date":"2024-09-14","runtime":24,"still_path":"https://image.tmdb.org/t/p/original/niDFAqiSunaeJ4R9tNHbM3p7J4w.jpg","vote_average":0},"12":{"name":"A Espada de Hoshitama","overview":"Sakuna não é capaz de derrotar Omizuchi com o equipamento que tem. A única escolha parece ser forjar novamente a Espada de Hoshidama, mas isso implica perder a existência de Tama...","air_date":"2024-09-21","runtime":24,"still_path":"https://image.tmdb.org/t/p/original/vdSRcuPyfJbipV5FKHWJteAABM4.jpg","vote_average":0},"13":{"name":"Princesa Sakuna do Arroz dos Céus","overview":"Um grande festival acontece na ilha, enquanto Sakuna se prepara para o combate final. Que segredos escondem o lugar onde se abriga Omizuchi e será Sakuna capaz de acabar com o mal na ilha?","air_date":"2024-09-28","runtime":27,"still_path":"https://image.tmdb.org/t/p/original/m0yfptzkNWHaUg24R6p7FDyMKqH.jpg","vote_average":0}}}}},
